  console.log(icon);
  
  return(
  icon === 1 ? (
    <>
      {console.log("inside")}
      <button onClick={() => dispatch(setFooterInfo("veg"))}>Veg</button>
      <button onClick={() => dispatch(setFooterInfo("nonveg"))}> Nonveg</button>
      <button onClick={() => dispatch(setFooterInfo("favourite"))}>
        favourite
      </button>
    </>
  ) : (
    <>
      {console.log("outside")}
      <button>saveData</button>
    </>
  )
  )
};

export default Footer;
